export default function Dictionnaire() {
  return (
    <div>
      <h2>Dictionnaire</h2>
      <table border="1">
        <thead>
          <tr><th>Mot</th><th>Définition</th></tr>
        </thead>
        <tbody>
          <tr><td>Exemple</td><td>Ceci est une définition.</td></tr>
        </tbody>
      </table>
    </div>
  );
}
